    const fetchParticiones = async () => {
        try {
          const response = await fetch("http://localhost:8080/api/particion", {
            method: "GET",
          });
          const data = await response.json();
          const Particiones = data.filter(
            (task) => !task.schedule && !task.assigned
          );
          setParticiones(unassignedParticiones);
        } catch (error) {
          console.log(error);
        }
      };

